//styling
import './Intro.css';

import React from 'react';

//apis
// import {BrowserRouter, Routes, Route, Switch} from 'react-router-dom';


function Intro() {

    return (
        <div className='intro white-text'>
            <div className='left-col'>
            <div className='section-label left-col'>
                <ul>Next Generation of Index Management</ul>
               
            </div>
            
            <div className='sub-text left-col'>
                Making crypto investing simple by offering:
                <br/>
                Cross chain index funds   
                <br/>
                Composable index management
                <br/>
                Onramps to decentralized finance
            </div>
            

            <p className='signup-form left-col'>
                <form className='email-form '>
                    <div className='email-box'>
                        <input className='email-input' type='text' placeholder='Email*'></input>
                        <button>Early Access</button>
                    </div>
                </form>
            </p>
            </div>
        </div>
    );
}

export default Intro;
